import React, { Component } from 'react';
import Chip from '@material-ui/core/Chip';

const Style = {
    api: {
        color: 'lightblue',
        fontWeight: 'bolder',
        borderWidth: 2,
        borderColor: '#9100ca'
    }
};

export default class ChipsAPI extends Component {
    render() {
        return (
            <Chip label="Bootstrap" variant="outlined" style={Style.api}/>
        );
    }
}
